import React from 'react';
import Twitter from "../assets/icon/twitter-logo.png"
import Instagram from "../assets/icon/insta-logo.png"


function Compte(props){
	const c = 
		{
			prenom:"Nasser",
            nom:"Nourou",
            photo:"https://img-4.linternaute.com/ROUIuiso_K2p5B8_xuA9GZJ41CY=/2610x/smart/41072375ec4f4bae808550106194e814/ccmcms-linternaute/10656232.jpg",
            displayName:"Nasser Nourou",
            username:"nan0u_b1nks",
			dateCreation:"le 3 janvier 2022",
			points:2352,
			status:"Morphologie de type B majuscule",
			resaux:[
				{
					nom:"Instagram",
                    identifiant:"@nanou-B1nks",
					url:"200 €",
                    img:""
				},
				{
					nom:"Tweeter",
                    identifiant:"@nanou-B1nks",
					url:"Boutique physique et en ligne",
                    img:Twitter
				},
				{
					nom:"Snapchat",
                    identifiant:"@nanou-B1nks",
					url:"Soumettre sa tenu avant la date de fin",
                    img:""
				},
				{
					nom:"TikTok",
                    identifiant:"@nanou-B1nks",
					url:"Soumettre sa tenu avant la date de fin",
                    img:""
				},

			],
            proprietaire:true,
		}
    
	const compte = (
		<div className='w-100 h-100 d-flex align-items-center'>
			{
				(c.proprietaire===true) ?
                <div className="compte">
                    <img src={c.photo} alt="" className="comptePhoto" />
                    <h4 className="compteName">
                        {c.displayName}
                    </h4>
                    <h6 className="compteUsername">
                        @{c.username}
                    </h6>
                    <span className="comptePoint">
                        {c.points} points
                    </span>
                    <p className="compteStatut">
                        {c.status}
                    </p>
                    <ul className="compteReseaux">
                        <span className="mb-4 pb-4">Reseaux :</span>
                        {c.resaux.map(r => 
                        <li className="w-100">
                            <a href={r.url} className="w-100 compteLink">
                                <img src={r.img} alt="" className="icon" />
                                <div className="d-flex flex-column ms-3">
                                    <span>{r.nom}</span>
                                    <span className='fw-bold'> {r.identifiant}</span>
                                </div>
                            </a>
                        </li>	
                        )}
                    </ul>

                </div>
				:
                <div className="compte">
                    <img src={c.photo} alt="" className="comptePhoto" />
                    <h4 className="compteName">
                        {c.displayName}
                    </h4>
                    <h6 className="compteUsername">
                        @{c.userName}
                    </h6>
                    <span className="comptePoint">
                        {c.points}
                    </span>
                    <p className="compteStatut">
                        {c.status}
                    </p>
                    <ul className="compteReseaux">
                        {c.reseaux.map(r => 
                        <li className="w-100">
                            <a href={r.url} className="w-100 compteLink">
                                <img src={r.img} alt="" className="icon" />
                                <div className="d-flex flex-column ms-3">
                                    <span>{r.nom}</span>
                                    <span className='fw-bold'> {r.identifiant}</span>
                                </div>
                            </a>
                        </li>	
                        )}
                    </ul>

                </div>
			}
		</div>
	)

    return (
		<div className=" d-flex justify-content-center align-items-center w-100 h-100 p-4">
			{compte}
		</div>  
    );
}
export default Compte;
